  namespace: System.Web
  summary: "Gets an object that can be used to synchronize access to the collection."
  remarks: "Program code should generally perform synchronized operations on the SyncRoot of a collection, not directly on the collection itself. This ensures proper operation of collections that are derived from other objects. Specifically, it maintains proper synchronization with other threads that might be simultaneously modifying the collection object.       The object returned in this implementation is the <xref:System.Web.HttpStaticObjectsCollection> itself."
